import { BrowserRouter, Route, Routes } from "react-router-dom";
import Dashbord from "./pages/Dashbord";

export default function AppRoutes() {
    return (
        <BrowserRouter>
        <Routes>
            <Route path="/dashbord" element={<Dashbord/>} />
        </Routes>
        </BrowserRouter>
    )
}

export {}
